import './App.css';
import Playlistpage from "./Components/playlistpage"
import top50 from "./images/top50 global.jpg"
import jsondata from "./Components/data.json";

function App() {
let openplaylist = () => {
  alert("clicked")
}
  return (
    <div>
      <header>
      <ul>
        <li><img src={logo} style={{"height":"50px","width":"50px"}}/></li>
        <li>HOME</li>
        <li>ABOUT US</li>
        <li>PRICING</li>
      </ul>
      <h1>Recomended For You</h1>
          {
            jsondata[7].Recomended.map((data,i) => {
            return (
            <img onClick={openplaylist} key={i} src={data} style={{"height":"200px","width":"200px"}}/>
            )
            })
           }
           <h1>Your Daily Mix</h1>
          {
            jsondata[8].DailyMix.map((data,i) => {
            return (
            <img key={i} src={data} style={{"height":"200px","width":"200px"}}/>
            )
            })
           }
            <Playlistpage/>
      </header>
    </div>
  );
}

export default App;
